const schedulesReducer = (state = [], action) => {
	switch (action.type) {
		case 'CREATE': {
			return { ...state }
		}
		case 'UPDATE': {
			return { ...state }
		}
		case 'REMOVE': {
			return { ...state }
		}
		default:
			return state;
	}
};

export default schedulesReducer;
